import React, { useReducer } from 'react';
import { useDispatch } from 'react-redux';
import { getAnnimeAsync } from '../ducks/anime/slice';

const Page: React.FC = () => {
	const dispatch = useDispatch();

	return (
		<>
			<div onLoad={() => dispatch(getAnnimeAsync(2020, 1))}>test</div>
		</>
	);
};

export default Page;
